pragma solidity 0.6.11;

import "../../openzeppelin-contracts-master/contracts/token/ERC721/ERC721.sol";
import "../../openzeppelin-contracts-master/contracts/utils/Counters.sol";

contract Cina is ERC721 {
    using Counters for Counters.Counter;
    Counters.Counter private _cinaIds;

    constructor () public ERC721 ("Identit numrique", "CINA") {}

    function addPet(address owner, string memory cinaURI) public returns (uint256) {
        _cinaIds.increment();

        uint256 newCinaId = _cinaIds.current();
        _mint(owner, newCinaId);
        _setTokenURI(newCinaId, cinaURI);

        return newCinaId;
    }
}
